import _ from "lodash";

export function getSum(transaction, type) {
    console.log(type);
  let sum = _(transaction)
    .groupBy("type")
    .map((obj, key) => {
      return obj
    })
    .value();
  console.log(sum);
}
export function getLabels() {}
